function setRadioButtons (id, prefix, trueValue, falseValue, value) {
  const RADIOON = '<font color="#08F">&#x25C9;</font>'
  const RADIOOFF = '&#x25CE;'
  const element = document.getElementById(id)
  const text = `<span style="display: flex; justify-content: space-between"><span>${prefix}&nbsp;</span>` +
             `<span>${value ? RADIOON : RADIOOFF}${trueValue} ${!value ? RADIOON : RADIOOFF}${falseValue}</span></span>`
  element.innerHTML = text
}

/* ------ Rendering the model ------ */

function renderModel () {
  document.getElementById('svoxerrors').innerHTML = ''
  document.getElementById('svoxstats').innerHTML = ''

  let model = document.getElementById('model')
  if (model) { model.parentNode.removeChild(model) }

  SVOX.models.__playground = editor.getValue().replace('%ENVIRONMENT%', day ? environmentDaySmall : environmentNightSmall)
  const container = document.getElementById('container')
  model = render(container, 'a-entity', {
    id: 'model',
    svox: { model: '__playground', worker: true, workerPath: '../dist/svox.worker.js' },
    shadow: { cast: shadow, receive: shadow }
  })
}

/* ------ Generating a model from a formula and palette ------ */

function generateModel () {
  try {
    document.getElementById('formulaerrors').innerHTML = ''

    const sizeText = document.getElementById('size')
    const size = parseInt(Math.min(Math.max(1, sizeText.value), 200))
    sizeText.value = size.toString()

    const paletteName = document.getElementById('palettes').value
    const palette = PALETTES.find(p => p.name === paletteName)
    const direction = document.getElementById('direction').value

    const formula = formulaEditor.getValue()
    const func = new Function('size', 'x', 'y', 'z', 'noise', 'ctx', formula)
    const noise = SVOX.Noise().noise
    let voxels = ''
    const ctx = {}
    for (let vz = 0; vz < size; vz++) {
      for (let vy = 0; vy < size; vy++) {
        for (let vx = 0; vx < size; vx++) {
          const x = vx + 0.5 - size / 2
          const y = vy + 0.5 - size / 2
          const z = vz + 0.5 - size / 2
          const result = func(size, x, y, z, noise, ctx)

          let color = '-'
          if (typeof result === 'string') { color = result } else if (result < 1) {
            let d = 0
            switch (direction) {
              case 'Up' : d = (y + size / 2) / size; break
              case 'Down' : d = 1 - (y + size / 2) / size; break
              case 'Right' : d = (x + size / 2) / size; break
              case 'Left' : d = 1 - (x + size / 2) / size; break
              case 'Front' : d = (z + size / 2) / size; break
              case 'Back' : d = 1 - (z + size / 2) / size; break
              case 'Out' : d = Math.max(Math.abs(x), Math.abs(y), Math.abs(z)) / (size / 2); break
              case 'In' : d = 1 - Math.max(Math.abs(x), Math.abs(y), Math.abs(z)) / (size / 2); break
              case 'X-Out' : d = Math.max(Math.abs(y), Math.abs(z)) / (size / 2); break
              case 'X-In' : d = 1 - Math.max(Math.abs(y), Math.abs(z)) / (size / 2); break
              case 'Y-Out' : d = Math.max(Math.abs(x), Math.abs(z)) / (size / 2); break
              case 'Y-In' : d = 1 - Math.max(Math.abs(x), Math.abs(z)) / (size / 2); break
              case 'Z-Out' : d = Math.max(Math.abs(x), Math.abs(y)) / (size / 2); break
              case 'Z-In' : d = 1 - Math.max(Math.abs(x), Math.abs(y)) / (size / 2); break
            }
            color = 'ABCDEFGHIJKLMNOP'[Math.max(Math.min(15, Math.floor(palette.size * d)))]
          }

          voxels += color
        }
        voxels += ' '
      }
      voxels += '\r\n'
    }

    const smooth = document.getElementById('form').value.startsWith('Smooth')
    const ao = document.getElementById('form').value.endsWith('AO')

    editor.setValue(
      `${paletteName.endsWith('Glass') ? `texture id = env, image = ${day ? environmentDaySmall : environmentNightSmall}\r\n\r\n` : ''}` +
      'model\r\n' +
      `size = ${size} ${size} ${size}\r\n` +
      'shape = box // sphere\r\n' +
      `scale = ${(1 / size).toFixed(3)}\r\n` +
      'autoresize = true\r\n' +
      'origin = -y\r\n' +
      'wireframe = false\r\n' +
      (ao ? 'ao = 5 1\r\n' : '') +
      'clamp = none\r\n' +
      (smooth ? 'material lighting = smooth, deform = 4' : 'material lighting = flat') +
      (palette.material.indexOf('roughness') === -1 && smooth ? ', roughness = 0.2' : '') +
      palette.material + '\r\n' +
      `  colors = ${palette.colors.replace('flat', smooth ? 'smooth' : 'flat')}\r\n` +
      'voxels\r\n' +
      voxels
      , -1)
    editor.gotoLine(1)
  } catch (exception) {
    document.getElementById('formulaerrors').innerHTML = exception.name + ': ' + exception.message
  }
}

/* ------ Loading a Smooth Voxel file ------ */

function loadSvox () {
  const fileUpload = document.createElement('input')
  fileUpload.setAttribute('type', 'file')
  fileUpload.setAttribute('accept', '.svox')

  fileUpload.onchange = handleSvoxUpload
  fileUpload.click()
}

function handleSvoxUpload (e) {
  let file = null

  if (e.target && e.target.files && e.target.files.length > 0) {
    file = e.target.files[0]
  }

  const reader = new FileReader()

  reader.onload = function () {
    let model = reader.result
    model = model.replace(/(\r\n|\n)/gm, '\r\n')
    model = model.replace('%ENVIRONMENT%', day ? environmentDaySmall : environmentNightSmall)
    editor.setValue(model, -1)
    editor.gotoLine(1)
    if (!autoRender) { renderModel() }
  }

  reader.onerror = function () {
    alert(reader.error)
  }

  reader.readAsText(file)
}

/* ------ Reloading a MagicaVoxel file ------ */

function reloadMagicaVoxel () {
  const fileUpload = document.createElement('input')
  fileUpload.setAttribute('type', 'file')
  fileUpload.setAttribute('accept', '.vox')

  fileUpload.onchange = handleMagicaVoxelUpload
  fileUpload.click()
}

function handleMagicaVoxelUpload (e) {
  let file = null

  if (e.target && e.target.files && e.target.files.length > 0) {
    file = e.target.files[0]
  }

  const reader = new FileReader()

  reader.onload = function () {
    let model
    try {
      const modelString = editor.getValue()
      if (modelString.trim().length > 0) {
        model = ModelReader.readFromString(modelString)
        model.voxels.reset()
      } else {
        model = new Model()
        model.scale = { x: 0.01, y: 0.01, z: 0.01 }
        model.origin = '-y'
      }
    } catch (ex) {
      document.getElementById('svoxerrors').innerHTML = ex
      return
    }

    try {
      convertMagicaVoxel(parseMagicaVoxel(reader.result), model)
      editor.setValue(ModelWriter.writeToString(model, false), -1)
      editor.gotoLine(1)
      if (!autoRender) { renderModel() }
    } catch (ex) {
      alert(ex.message + '\r\n\r\nTry saving using the last version of MagicaVoxel.\r\nNote that scenes are not supported.')
    }
  }

  reader.onerror = function () {
    alert(reader.error)
  }

  reader.readAsArrayBuffer(file)
};

function convertMagicaVoxel (vox, model) {
  // Alpha channel is unused(?) in Magica voxel, so just use the same material for all
  // If all colors are already available this new material will have no colors and not be written by the modelwriter
  const newMaterial = model.materials.createMaterial(SVOX.MATSTANDARD, SVOX.FLAT)

  // Palette map (since palette indices can be moved in Magica Voxel by CTRL-Drag)
  const iMap = []
  if (vox.IMAP) {
    for (let i = 1; i <= vox.IMAP.pal_indices.length; i++) {
      iMap[vox.IMAP.pal_indices[i - 1]] = i
    }
  }

  vox.XYZI.forEach(function (v) {
    const c = v.c
    const cId = iMap[v.c] || v.c
    let svoxcol = model.materials.findColorByExId(cId)
    if (!svoxcol) {
      const voxcol = vox.RGBA[c - 1]
      svoxcol = newMaterial.addColorRGB(voxcol.r / 255, voxcol.g / 255, voxcol.b / 255)
      svoxcol.exId = cId
    }

    model.voxels.setVoxel(v.x, v.z, -v.y, new Voxel(svoxcol, model.materials))
  })

  // let scale = 1 / Math.max(model.voxels.bounds.size.x, model.voxels.bounds.size.y, model.voxels.bounds.size.z);
  // model.scale = { x:scale, y:scale, z:scale };
}

/* ------ Create a model from an image ------ */

function loadImage () {
  const fileUpload = document.createElement('input')
  fileUpload.setAttribute('type', 'file')
  fileUpload.setAttribute('accept', '.png, .jpg, .gif')

  fileUpload.onchange = handleImageUpload
  fileUpload.click()
}

function handleImageUpload (e) {
  let file = null

  if (e.target && e.target.files && e.target.files.length > 0) {
    file = e.target.files[0]
  }

  if (file.type.startsWith('image/')) {
    const img = new Image()

    // All the handling is done in convertImage
    img.onload = convertImage

    img.onerror = function () {
      alert('The image could not be loaded')
    }

    img.src = URL.createObjectURL(this.files[0])
  }
};

function convertImage () {
  const uploadCanvas = document.createElement('canvas')
  uploadCanvas.id = 'uploadCanvas'

  uploadCanvas.width = this.width
  uploadCanvas.height = this.height
  const ctx = uploadCanvas.getContext('2d')
  ctx.drawImage(this, 0, 0)
  const pixels = ctx.getImageData(0, 0, this.width, this.height)

  const size = Math.max(this.width, this.height)

  const model = new Model()
  model.scale = { x: 1 / size, y: 0.1, z: 1 / size }
  model.origin = '+z'
  model.rotation = { x: 90, y: 0, z: 0 }

  const material = model.materials.createMaterial(SVOX.MATSTANDARD, SVOX.BOTH, 0.5, 0, true)
  material.setDeform(10)
  material.clamp = 'y'

  let pixel = 0
  const colors = {}
  for (let z = 0; z < this.height; z++) {
    for (let x = 0; x < this.width; x++) {
      // 4096 Colors
      // let col = ((pixels.data[pixel+0]&0xF0)<<5) + ((pixels.data[pixel+1]&0xD0)) + ((pixels.data[pixel+2]&0xF0)>>4);

      // 512 Colors
      const col = ((pixels.data[pixel + 0] & 0xE0) << 4) + ((pixels.data[pixel + 1] & 0xE0)) + ((pixels.data[pixel + 2] & 0xE0) >> 4)

      let hex = '000' + Number(col).toString(16)
      hex = '#' + hex.substr(hex.length - 3, 3)

      if (pixels.data[pixel + 3] > 0) {
        let color = colors[hex]
        if (!color) {
          color = Color.fromHex(hex)
          colors[hex] = color
          material.addColor(color)
        }

        model.voxels.setVoxel(x, 0, z, new Voxel(color, model.materials))
      }
      pixel += 4
    }
  }

  editor.setValue(ModelWriter.writeToString(model, false), -1)
  editor.gotoLine(1)
  if (!autoRender) { renderModel() }
};

