/* ------ SVOX model downloads ------ */

function downloadTextAsShown () {
  downloadTextFile(editor.getValue().replace(/(\r\n|\n)/gm, '\r\n'), 'model.svox')
}

function downloadUncompressed (repeat) {
  const model = ModelReader.readFromString(editor.getValue())
  downloadTextFile(ModelWriter.writeToString(model, false, repeat), 'model.svox')
}

function downloadCompressed () {
  const model = ModelReader.readFromString(editor.getValue())
  downloadTextFile(ModelWriter.writeToString(model, true), 'model.min.svox')
}

function downloadAFrameComponent (fullScene, compressed, digits) {
  const model = ModelReader.readFromString(editor.getValue())
  const svoxmesh = SvoxMeshGenerator.generate(model)
  downloadTextFile(SvoxToAFrameConverter.generate(svoxmesh, fullScene, compressed, digits), fullScene ? 'myscene.html' : 'mymodel.js')
}

function downloadGltf (binary) {
  try {
    const model = document.getElementById('model')
    if (model) {
      const exporter = new GLTFExporter()
      const exportoptions = {
        binary,
        onlyVisible: true,
        trs: true,
        embedImages: true,
        forcePowerOfTwoTextures: false,
        truncateDrawRange: false,
        forceIndices: true
      }

      // Parse the input and generate the glTF output
      const mesh = model.getObject3D('mesh')
      exporter.parse(mesh, function (gltf) {
        if (binary) { downloadGlbFile(gltf, 'svoxmodel.glb') } else { downloadTextFile(JSON.stringify(gltf), 'svoxmodel.gltf') }
      }, exportoptions)
    } else {
      alert('No model to export')
    }
  } catch (error) {
    alert('The model could not be exported.\r\n\r\nSee the browser console and the documentation on material types for more information.')
  }
}

function downloadGlbFile (body, name) {
  const a = document.createElement('a')
  const type = name.split('.').pop()
  a.href = URL.createObjectURL(new Blob([body], { type: `gltf-binary/${type}` }))
  a.download = name
  a.click()
}

function downloadTextFile (text, name) {
  const a = document.createElement('a')
  const type = name.split('.').pop()
  a.href = URL.createObjectURL(new Blob([text], { type: `text/${type === 'txt' ? 'plain' : type}` }))
  a.download = name
  a.click()
}

function copyViewerUrl () {
  let url = window.location.origin + '/playground.html?'
  url += day ? '' : 'd=0&'
  url += background ? '' : 'g=0&'
  url += environment ? '' : 'e=0&'
  url += baseVisible ? '' : 'b=0&'
  url += lights ? '' : 'l=0&'
  url += rotateModel ? '' : 'r=0&'
  url += shadow ? '' : 's=0&'
  url += 'f=1&c=1&m='
  const model = ModelReader.readFromString(editor.getValue())
  let modelstring = ModelWriter.writeToString(model, true)
  modelstring = modelstring.replace(/(\s*=\s*)/gm, '=')
  modelstring = modelstring.replace(/(\s*,\s*)/gm, ',')
  modelstring = modelstring.replace(/(\r\n|\n)/gm, '\n')
  url += encodeURIComponent(modelstring)
  if (url.length > 8000) { alert('\nUrl copied to clipboard.\n\nNote: This viewer url is very large and will likely not work in most browsers!') } else { alert('\nUrl copied to clipboard.') }
  copyToClipboard(url)
}

function copyToClipboard (text) {
  if (window.clipboardData && window.clipboardData.setData) {
    // IE specific code path to prevent textarea being shown while dialog is visible.
    return window.clipboardData.setData('Text', text)
  } else if (document.queryCommandSupported && document.queryCommandSupported('copy')) {
    const textarea = document.createElement('textarea')
    textarea.textContent = text
    textarea.style.position = 'fixed' // Prevent scrolling to bottom of page in MS Edge.
    document.body.appendChild(textarea)
    textarea.select()
    try {
      return document.execCommand('copy') // Security exception may be thrown by some browsers.
    } catch (ex) {
      // Fallback to file download
      downloadTextFile(text, 'viewerurl.txt')

      return false
    } finally {
      document.body.removeChild(textarea)
    }
  }
}

