// /playground/svoxtoaframeconverter.js
// =====================================================

class SvoxToAFrameConverter {
  static generate (model, fullScene, compressed, digits) {
    if (!digits) digits = 4

    let result = ''

    if (fullScene) {
      result += '<!DOCTYPE html>\n'
      result += '<html>\n'
      result += '  <head>\n'
      result += '\n'
      result += '    <script>\n'
      result += '        // Uncomment to force the page to HTTPS\n'
      result += '        // if (location.protocol != \'https:\') {\n'
      result += '        //   location.href = \'https:\' + location.href.substring(window.location.protocol.length);\n'
      result += '        // }\n'
      result += '    </script>\n'
      result += '\n'
      result += '    <script src="https://aframe.io/releases/1.2.0/aframe.min.js"></script>\n'
      result += '\n'
      result += '    <script>\n'
      result += '\n'
      result += '// This scene was generated by https://svox.glitch.me/playground.html\n'
      result += '// Note that the Smooth Voxels library is not needed since the model was generated to javascript.\n'
      result += '\n'
    } else {
      result += '\n'
      result += '\n'
      result += '\n'
      result += '// Aframe component, use in an A-Frame scene as: <a-entity mymodel position="0 1 -2" />\n'
      result += '// This component was generated by https://svox.glitch.me/playground.html\n'
    }

    result += 'AFRAME.registerComponent("mymodel", {\n'
    result += '  schema: {  },\n'
    result += '  init: function () {\n'
    result += '    if (!this.init.mesh) {\n'
    result += '      // Cache the mesh for reuse\n'
    result += '      this.init.mesh = this._createMesh();\n'
    result += '      this.mesh = this.init.mesh;\n'
    result += '    }\n'
    result += '    else {\n'
    result += '      // If this component is used multiple times, reuse the mesh\n'
    result += '      this.mesh = new THREE.Mesh(this.init.mesh.geometry, this.init.mesh.material);\n'
    result += '    }\n'
    result += '    this.el.setObject3D(\'mesh\', this.mesh);\n'
    result += '  },\n'
    result += '\n'
    result += SvoxToAFrameConverter._createMeshFunction(model, compressed, digits)
    result += '\n'
    result += '});\n'

    if (fullScene) {
      result += '\n'
      result += '    </script>\n'
      result += '\n'
      result += '  </head>\n'
      result += '  <body>\n'
      result += '\n'
      result += '    <a-scene id="scene">\n'
      result += '\n'
      result += '      <a-sky color="#0AF"></a-sky>\n'
      result += '\n'
      result += '      <a-entity mymodel\n'
      result += '                position="0 1 -1.5"\n'
      result += '                animation="property: rotation; from: 0 360 0; to: 0 0 0; loop: true; dur: 10000; easing:linear;">\n'
      result += '      </a-entity>\n'
      result += '\n'
      result += '    </a-scene>\n'
      result += '\n'
      result += '  </body>\n'
      result += '\n'
      result += '  <script>\n'
      result += '\n'
      result += '    // Set the environment map for standard materials without a specific environment map\n'
      result += '    let scene = document.getElementById(\'scene\');\n'
      result += '    let environment = new THREE.TextureLoader().load("data:image/jpeg;base64,");\n'
      result += '    environment.encoding = THREE.sRGBEncoding;\n'
      result += '    environment.mapping = THREE.EquirectangularReflectionMapping;\n'
      result += '    scene.object3D.environment = environment;\n'
      result += '\n'
      result += '  </script>\n'
      result += '\n'
      result += '</html>\n'
    }

    return result
  }

  static _createMeshFunction (model, compressed, digits) {
    let result = '  _createMesh: function() {\n'
    result += '    let materials = [];\n'
    result += '\n'
    model.materials.forEach(function (material) {
      result += `${SvoxToAFrameConverter._generateMaterial(material)}`
    }, this)

    result += '    let geometry = new THREE.BufferGeometry();\n'
    result += '\n'

    const coldigits = Math.min(3, Math.max(2, digits))
    const round = this._round

    if (compressed) {
      result += '    let decompress = function(c){let d=[],i=0,s,l;while(i<c.length)if(c[i]===undefined){s=d.length-c[i+1],l=c[i+2];i+=3;while(l-->0)d.push(d[s++])}else d.push(c[i++]);return d};\n'
      result += '    let undiff = function(a){for(let i=1;i<a.length;i++)a[i]=a[i-1]+a[i];return a};\n'
      result += '\n'
      result += '    // Set the geometry attribute buffers\n'
      result += `    geometry.setAttribute( 'position', new THREE.Float32BufferAttribute( decompress([ ${this._compress(round(model.positions, digits)).map(f => this._toString(f))} ]), 3) );\n`
      result += `    geometry.setAttribute( 'normal',   new THREE.Float32BufferAttribute( decompress([ ${this._compress(round(model.normals, digits)).map(f => this._toString(f))} ]), 3) );\n`
      result += `    geometry.setAttribute( 'color',    new THREE.Float32BufferAttribute( decompress([ ${this._compress(round(model.colors, coldigits)).map(f => this._toString(f))} ]), 3) );\n`
      if (model.uvs) {
        result += `    geometry.setAttribute( 'uv',     new THREE.Float32BufferAttribute( [ ${model.uvs.map(f => f === undefined ? '' : this._toString(f, digits))} ], 2) );\n`
        result += '    geometry.uvsNeedUpdate = true;\n'
      }
      if (model.data) {
        for (let d = 0; d < model.data.length; d++) {
          result += `    geometry.setAttribute( '${model.data[d].name}', new THREE.Float32BufferAttribute( decompress([ ${this._compress(model.data[d].values).map(f => this._toString(f))} ]), ${model.data[d].width}) );\n`
        }
      }
      result += `    geometry.setIndex( undiff( decompress([ ${this._compress(this._diffEncode(model.indices))} ])));\n`
    } else {
      result += '    // Set the geometry attribute buffers\n'
      result += `    geometry.setAttribute( 'position', new THREE.Float32BufferAttribute( [ ${round(model.positions, digits).map(f => this._toString(f))} ], 3) );\n`
      result += `    geometry.setAttribute( 'normal',   new THREE.Float32BufferAttribute( [ ${round(model.normals, digits).map(f => this._toString(f))} ], 3) );\n`
      result += `    geometry.setAttribute( 'color',    new THREE.Float32BufferAttribute( [ ${round(model.colors, coldigits).map(f => this._toString(f))} ], 3) );\n`
      if (model.uvs) {
        result += `    geometry.setAttribute( 'uv',     new THREE.Float32BufferAttribute( [ ${model.uvs.map(f => f === undefined ? '' : this._toString(f, 4))} ], 2) );\n`
        result += '    geometry.uvsNeedUpdate = true;\n'
      }
      if (model.data) {
        for (let d = 0; d < model.data.length; d++) {
          result += `    geometry.setAttribute( '${model.data[d].name}', new THREE.Float32BufferAttribute( [ ${model.data[d].values.map(f => this._toString(f))} ], ${model.data[d].width}) );\n`
        }
      }
      result += `    geometry.setIndex( [ ${model.indices} ]);\n`
    }

    result += '\n'
    result += '    // Add the groups for each material\n'
    model.groups.forEach(function (group) {
      result += `    geometry.addGroup(${group.start}, ${group.count}, ${group.materialIndex});\n`
    }, this)

    result += '\n'
    result += '    geometry.computeBoundingBox();\n'

    result += '\n'
    result += '    return new THREE.Mesh(geometry, materials);\n'
    result += '  }\n'

    return result
  }

  // Compress by previous lookup, similar to LZ compression.
  static _compress (array) {
    const startPositions = {}
    const compressed = []
    let compressedIndex = 0
    for (let i = 0; i < array.length; i++) {
      let bestStart = 0
      let bestLength = 0
      const starts = startPositions[array[i]]
      if (starts === undefined) {
        startPositions[array[i]] = []
      } else {
        for (let j = 0; j < starts.length; j++) {
          const start = starts[j]
          let length = 1
          while (i + length < array.length && array[start + length] === array[i + length]) {
            length++
          }
          if (length >= bestLength && length > 3) {
            bestStart = start
            bestLength = length
          }
        }
      }
      if (bestLength) {
        for (let k = i; k < i + bestLength; k++) { startPositions[array[k]].push(k) }
        compressed[compressedIndex++] = undefined // Pattern marker
        compressed[compressedIndex++] = i - bestStart
        compressed[compressedIndex++] = bestLength
        i += bestLength - 1
      } else {
        startPositions[array[i]].push(i)
        compressed[compressedIndex++] = array[i]
      }
    }
    return compressed
  }

  // Convert the indices by storing the differences between subsequent values making it much better to compress
  static _diffEncode (array) {
    let lastValue = array[0]
    for (let i = 1; i < array.length; i++) {
      const value = array[i]
      array[i] = value - lastValue
      lastValue = value
    }
    return array
  }

  static _undiff (array) {
    for (let i = 1; i < array.length; i++) {
      array[i] = array[i - 1] + array[i]
    }
  }

  static _round (array, digits) {
    const pow = Math.pow(10, digits)
    for (let i = 0; i < array.length; i++) {
      array[i] = Math.round((array[i] + Number.EPSILON) * pow) / pow
    }
    return array
  }

  static _toString (value) {
    if (value === undefined) { return undefined }

    let str = value.toString()

    // Remove leading 0
    if (str.substring(0, 2) === '0.') { str = str.substr(1) }
    if (str.substring(0, 3) === '-0.') { str = '-' + str.substr(2) }

    return str
  }

  static _generateMaterial (definition) {
    let result = '    materials.push(new THREE.'
    switch (definition.type) {
      case 'standard':
        result += 'MeshStandardMaterial({\n'
        break
      case 'basic':
        result += 'MeshBasicMaterial({\n'
        break
      case 'lambert':
        result += 'MeshLambertMaterial({\n'
        break
      case 'phong':
        result += 'MeshPhongMaterial({\n'
        break
      case 'matcap':
        result += 'MeshMatcapMaterial({\n'
        break
      case 'toon':
        result += 'MeshToonMaterial({\n'
        break
      case 'normal':
        result += 'MeshNormalMaterial({\n'
        break
      default: {
        throw {
          name: 'SyntaxError',
          message: `Unknown material type '${definition.type}'.`
        }
      }
    }

    // Remove / add parameters depending on material type, this also prevents console warnings
    if (definition.type === 'standard') {
      result += `      roughness: ${definition.roughness},\n`
      result += `      metalness: ${definition.metalness},\n`
    }

    if (definition.type === 'basic' || definition.type === 'lambert' || definition.type === 'phong') {
      result += `      reflectivity: ${1 - definition.roughness},\n`
    }

    if (definition.type !== 'matcap' && definition.wireframe) {
      result += '      wireframe: true,\n'
    }

    result += '      vertexColors: true,\n'
    result += `      opacity: ${definition.opacity},\n`
    result += `      alphaTest: ${definition.alphaTest},\n`
    result += `      transparent: ${definition.transparent},\n`
    result += `      refractionRatio: ${definition.refractionRatio},\n`
    result += `      fog: ${definition.fog},\n`

    switch (definition.side) {
      case 'back': result += '      side: THREE.BackSide,\n'; break // Should never happen, faces are reversed instead
      case 'double': result += '      side: THREE.DoubleSide,\n'; break
      default:
        break
    }

    result += '\n'
    if (definition.map) {
      result += `      map: ${SvoxToAFrameConverter._generateTexture(definition.map.image, true, definition.map.uscale, definition.map.vscale,
                                                                     definition.map.uoffset, definition.map.voffset, definition.map.rotation)},\n\n`
    }

    if (definition.normalMap) {
      result += `      normalMap: ${SvoxToAFrameConverter._generateTexture(definition.normalMap.image, false, definition.normalMap.uscale, definition.normalMap.vscale,
                                                                           definition.normalMap.uoffset, definition.normalMap.voffset, definition.normalMap.rotation)},\n\n`
    }

    if (definition.roughnessMap) {
      result += `      roughnessMap: ${SvoxToAFrameConverter._generateTexture(definition.roughnessMap.image, false, definition.roughnessMap.uscale, definition.roughnessMap.vscale,
                                                                              definition.roughnessMap.uoffset, definition.roughnessMap.voffset, definition.roughnessMap.rotation)},\n\n`
    }

    if (definition.metalnessMap) {
      result += `      metalnessMap: ${SvoxToAFrameConverter._generateTexture(definition.metalnessMap.image, false, definition.metalnessMap.uscale, definition.metalnessMap.vscale,
                                                                              definition.metalnessMap.uoffset, definition.metalnessMap.voffset, definition.metalnessMap.rotation)},\n\n`
    }

    if (definition.emissiveMap) {
      result += `      emissiveMap: ${SvoxToAFrameConverter._generateTexture(definition.emissiveMap.image, false, definition.emissiveMap.uscale, definition.emissiveMap.vscale,
                                                                             definition.emissiveMap.uoffset, definition.emissiveMap.voffset, definition.emissiveMap.rotation)},\n\n`
    }

    if (definition.matcap) {
      result += `      matcap: ${SvoxToAFrameConverter._generateTexture(definition.matcap.image, true)},\n\n`
    }

    if (definition.reflectionMap) {
      result += `      envMap: ${SvoxToAFrameConverter._generateEnvMap(definition.reflectionMap.image, false)},\n\n`
    }

    if (definition.refractionMap) {
      result += `      envMap: ${SvoxToAFrameConverter._generateEnvMap(definition.refractionMap.image, true)},\n\n`
    }

    result = result.substring(0, result.lastIndexOf(',')) + '\n'
    result += '    }));\n\n'

    return result
  }

  static _generateTexture (image, rgb, uscale, vscale, uoffset, voffset, rotation) {
    let result = '(function() {\n'
    result += `        let texture = new THREE.TextureLoader().load( "${image}" );\n`
    if (rgb) { result += '        texture.encoding = THREE.sRGBEncoding\n' } else { result += '        texture.encoding = THREE.LinearEncoding\n' }
    result += `        texture.repeat.set(${1 / (uscale || 1)}, ${1 / (vscale || 1)});\n`
    result += '        texture.wrapS = THREE.RepeatWrapping;\n'
    result += '        texture.wrapT = THREE.RepeatWrapping;\n'
    result += `        texture.offset = new THREE.Vector2(${uoffset || 0}, ${voffset || 0});\n`
    result += `        texture.rotation = ${rotation} * Math.PI / 180;\n`
    result += '        return texture;\n'
    result += '      })()'
    return result
  }

  static _generateEnvMap (image, refraction) {
    let result = '(function() {\n'
    result += `        let texture = new THREE.TextureLoader().load( "${image}" );\n`
    result += '        texture.encoding = THREE.sRGBEncoding\n'
    if (refraction) {
      result += '        texture.mapping = THREE.EquirectangularRefractionMapping\n'
      result += '        texture.refractionRatio = 0.5\n'
    } else { result += '        texture.mapping = THREE.EquirectangularReflectionMapping\n' }
    result += '        return texture;\n'
    result += '      })()'
    return result
  }
}

